CREATE TABLE people_table (id INT AUTO_INCREMENT PRIMARY KEY, gender CHAR(1), name VARCHAR(255), alter_name VARCHAR(255), surname1 VARCHAR(255), surname2 VARCHAR(255), birth DATE, fathername VARCHAR(255), fathersurname1 VARCHAR(255), fathersurname2 VARCHAR(255), mothername VARCHAR(255), mothersurname1 VARCHAR(255), mothersurname2 VARCHAR(255), father_grandfathername VARCHAR(255), father_grandmothername VARCHAR(255), mother_grandfathername VARCHAR(255), mother_grandmothername VARCHAR(255));
